import React from 'react';
import image from './char_sheet.jpg';

function ImageComponent({ userText, onUserTextChange }) {
  return (
    <div className="image-container">
      <img src={image} alt="Character Sheet" />
      <div className="text-box" style={{ top: '10%', left: '10%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
      <div className="text-box" style={{ top: '20%', left: '20%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
      <div className="text-box" style={{ top: '30%', left: '30%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
      <div className="text-box" style={{ top: '40%', left: '40%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
      <div className="text-box" style={{ top: '50%', left: '50%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
      <div className="text-box" style={{ top: '60%', left: '60%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
      <div className="text-box" style={{ top: '70%', left: '70%' }}>
        <input
          type="text"
          placeholder="Enter your text"
          value={userText}
          onChange={(e) => onUserTextChange(e.target.value)}
        />
      </div>
    </div>
  );
}

export default ImageComponent;
